 @徐圓圓  acrylamide只要你的食物有asparagine，在高溫下(煎烤炸等)就會產生
也就是你攝取的食物除非是全水煮或蒸，很難不攝取到acrylamine

所以為什麼有人會說食材盡量不要煎烤炸，主要就是食物褐變產生的有害物質太多，另外就是營養價值會流失較多(比起水煮和蒸

